import React from 'react'
import Navbar from './Navbar';
import { MDBContainer,MDBCol,MDBRow, MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBIcon } from "mdbreact";

function About() {
    return (
        <>
            <Navbar />
            <MDBContainer mt="4" className="mt-4 details_container">
            <MDBCard className="card_container text-center text-white mdb-color darken-1">
                <MDBCardBody>
                    <MDBCardTitle className="white-text mt-3">About Us</MDBCardTitle>
                    <hr className="hr-text" data-content=""></hr>
                    {/* <MDBCardText className="white-text">{userData.company}</MDBCardText> */}
                </MDBCardBody>
            </MDBCard>
            </MDBContainer>
        </>
    )
}

export default About
